function formatDurationShort(duration) {
    let timeText = ``;
    if (duration.days()) {
        timeText += `${duration.days()}Êó• ${duration.hours()}Êó∂ ${duration.minutes()}ÂàÜ ${duration.seconds()}Áßí`;
    } else if (duration.hours()) {
        timeText += `${duration.hours()}Êó∂ ${duration.minutes()}ÂàÜ ${duration.seconds()}Áßí`;
    } else if (duration.minutes()) {
        timeText += `${duration.minutes()}ÂàÜ ${duration.seconds()}Áßí`;
    } else {
        timeText += `${duration.seconds()}Áßí`;
    }
    return timeText;
}

function formatTimer(diff) {
    let timeLeft = diff;
    const stringArray = [];
    [
        [86400000, `d`],
        [3600000, `h`],
        [60000, `m`],
        [1000, `s`]
    ].forEach(([unit, suffix]) => {
        const time = Math.floor(timeLeft / unit);
        const first = stringArray.length === 0;
        if (!first || time > 0) {
            stringArray.push(time.toString().padStart(first ? 1 : 2, `0`) + suffix);
        }
        timeLeft -= time * unit;
    });
    return stringArray.join(` `);
}

